import {heroes} from './bases/data/heroes';
console.log(heroes)
let [letras]=heroes
console.log(letras.id) 
const getHeroesById=(id)=>{
    heroes.find(e=>{
        return e.id==id;
    })
}
const hero1=getHeroesById(1);
console.log(hero1)
